  if (args.Kind == ActivationKind.Protocol)
  {
    ProtocolActivatedEventArgs myProtocol = (ProtocolActivatedEventArgs)args;

    if (myProtocol.Uri.Scheme.Equals("protocolName"))
    {
      string path = myProtocol.Uri.AbsolutePath;
    }
  }
  #endregion
